/** Get the literal kind of a type
 * @param A
 * @returns **`'string' | 'number' | 'function' | 'array' | 'object' | 'number' | 'boolean'`**
 * @example
 * ```ts
 * ```
 */
export declare type Kind<A extends any> = A extends string ? 'string' : A extends number ? 'number' : A extends Function ? 'function' : A extends any[] ? 'array' : A extends object ? 'object' : A extends number ? 'number' : A extends boolean ? 'boolean' : 'unknown';
